import './App.css';
import './css/header.css';
import './css/body.css';
import './css/footer.css';
import './css/card-layout.css';
import GridP from './components/gridproyect/gridp.js';
import CardProyect from './components/cardProyects/CardProyect.js';

function App() {
  return (
    <div className="App">
      <header>Header</header>
      <main>
        <CardProyect/>
        <GridP/>
        <GridP/>
      </main>
      <footer>Footer</footer>
    </div>
  );
}

export default App;
